import * as React from 'react';
import { FaSpinner } from 'react-icons/fa';
impo

export function SpinnerBig () {

    return (
        <div className="margin-bottom-20 margin-top-20 flex justify-center">
            <div className="flex align-center">
                <FaSpinner icon="spinner" className="App-logo-spin" />
                <span className="margin-left-10 font-xx-large">Loading...</span>
            </div>
        </div>
    );
}

export function Spinner () {

    return (
        <div>
            <i className="fa fa-refresh fa-spin"></i>
            <span className="margin-left-10">Loading...</span>
        </div>
    );
}
